import React from 'react';
import { Dialog, DialogTitle } from '@material-ui/core';

const Modal = props => {

	const handleClose = () => {
		props.setDialog(false);
	}

	return (
		<Dialog onClose={handleClose} open={props.dialog}>
	      <DialogTitle>Set backup account</DialogTitle>
	      
	    </Dialog>
	);
}

export default Modal;
